export const styles = theme => ({
    landingstatsbox: {
        border: "1px solid #BAA2FC42",
        padding: 13,
        margin: 13,
        "& svg": {
            display: "block",
            margin: "auto",
            fontSize: 72,
            marginBottom: 13,
            color: "#CBCBCB",
        },
        "& span": {
            textAlign: "center",
            display: "block",
            color: "#CBCBCB",
        }
    }
});
